import React from 'react';
import './button.css';

function Button(props) {
  // Destructure size from props and set a default value
  const { size = 'medium' } = props;
  const buttonClass = size === 'medium' ? "medium" : size === 'low' ? 'low' : 'high';

  return (
    <button type="button" className={buttonClass}>
      Hi!
    </button>
  );
}

export default Button;
